import logo from "./img/S_logo.png";

const Topbar = () => {
  return (
    <div id="Topbar" className="T">
      <div className="title">
        <div className="title-logo">
          <img src={logo} alt="logo" srcset="" />
        </div>
        <div className="title-name">
          <p>Mate.ly</p>
        </div>
      </div>
    </div>
  );
};
export default Topbar;
